import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
    let result = props.data.map(ele => {

        <div className=''>
            <ExpenseItem date={ele.date} amount={ele.amount} title={ele.title}></ExpenseItem>
        </div>
    })
    return result

}

export default Expenses;
